// ÌÜµÍ¥Ä Í≤¨Ï†Å ÌéòÏù¥ÏßÄÎ•º ÏúÑÌïú Í∏∞Î≥∏ Íµ¨Ï°∞ (Ìëú Í∏∞Î∞ò)
import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

const customsItems = [
  {
    category: "ÏàòÏûÖ",
    items: [
      {
        name: "ÏàòÏûÖÏã†Í≥† ÏöîÏú®",
        unit: "ÏöîÏú®",
        price: 0.15,
        type: "rate",
      },
      {
        name: "ÏàòÏûÖÏã†Í≥† MIN",
        unit: "Í±¥Îãπ",
        price: 30000,
      },
      {
        name: "ÏàòÏûÖÏã†Í≥† MAX",
        unit: "Í±¥Îãπ",
        price: 300000,
      },
      {
        name: "ÏàòÏûÖÏã†Í≥† Ï†ïÏ†ï",
        unit: "Í±¥Îãπ",
        price: 20000,
      },
    ],
  },
  {
    category: "ÏàòÏ∂ú",
    items: [
      {
        name: "ÏàòÏ∂úÏã†Í≥† ÏöîÏú®",
        unit: "ÏöîÏú®",
        price: 0.15,
        type: "rate",
      },
      {
        name: "ÏàòÏ∂úÏã†Í≥† MIN",
        unit: "Í±¥Îãπ",
        price: 13000,
      },
      {
        name: "ÏàòÏ∂úÏã†Í≥† MAX",
        unit: "Í±¥Îãπ",
        price: 300000,
      },
      {
        name: "ÏàòÏ∂úÏã†Í≥† Ï†ïÏ†ï",
        unit: "Í±¥Îãπ",
        price: 10000,
        note: "Ìè¨Ïû• ÏàòÎüâ, Ï§ëÎüâÏóê Í¥ÄÌïú Ï†ïÏ†ï Ï†úÏô∏",
      },
    ],
  },
  {
    category: "ÌäπÌòúÏõêÏÇ∞ÏßÄ",
    items: [
      {
        name: "ÏõêÏÇ∞ÏßÄÌåêÏ†ï",
        unit: "ÌíàÎ™©Îãπ",
        price: 50000,
        note: "ÏÜåÏöî ÏûêÏû¨Ïàò 5Í∞ú Ï¥àÍ≥ºÏãú Í∞úÎãπ ÎßåÏõê Ï∂îÍ∞Ä",
      },
    ],
  },
];

export default function QuotationCustoms() {
  const navigate = useNavigate();
  const [formData, setFormData] = useState({});

  const handleChange = (name, value) => {
    setFormData((prev) => ({ ...prev, [name]: value }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    navigate("/customspreview", { state: { formData } });
  };

  return (
    <form onSubmit={handleSubmit} style={{ maxWidth: 900, margin: "0 auto", padding: 20 }}>
      <h1 style={{ fontSize: 24, fontWeight: "bold", marginBottom: 20 }}>ÌÜµÍ¥Ä Í≤¨Ï†ÅÏÑú ÏÉùÏÑ±</h1>
      {customsItems.map((section, idx) => (
        <div key={idx} style={{ marginBottom: 30 }}>
          <h2 style={{ fontSize: 20, marginBottom: 10 }}>{section.category}</h2>
          <table style={{ width: "100%", borderCollapse: "collapse" }}>
            <thead>
              <tr style={{ backgroundColor: "#f0f0f0" }}>
                <th style={{ padding: 10 }}>Ìï≠Î™©</th>
                <th style={{ padding: 10 }}>Îã®ÏúÑ</th>
                <th style={{ padding: 10 }}>Ï†úÏïàÍ∞ÄÍ≤©</th>
                <th style={{ padding: 10 }}>ÏàòÎüâ</th>
                <th style={{ padding: 10 }}>Ìï©Í≥Ñ</th>
                <th style={{ padding: 10 }}>ÎπÑÍ≥†</th>
              </tr>
            </thead>
            <tbody>
              {section.items.map((item, iidx) => {
                const quantity = Number(formData[item.name] || 0);
                const isRate = item.type === "rate";
                const total = isRate ? "-" : (item.price * quantity).toLocaleString();
                return (
                  <tr key={iidx}>
                    <td style={{ padding: 10 }}>{item.name}</td>
                    <td style={{ padding: 10 }}>{item.unit}</td>
                    <td style={{ padding: 10 }}>{
                      isRate ? `${item.price}%` : item.price.toLocaleString()
                    }</td>
                    <td style={{ padding: 10 }}>
                      {!isRate && (
                        <input
                          type="number"
                          min="0"
                          name={item.name}
                          value={formData[item.name] || ""}
                          onChange={(e) => handleChange(item.name, e.target.value)}
                          style={{ width: 80, padding: 6 }}
                        />
                      )}
                    </td>
                    <td style={{ padding: 10 }}>{total}</td>
                    <td style={{ padding: 10 }}>{item.note || ""}</td>
                  </tr>
                );
              })}
            </tbody>
          </table>
        </div>
      ))}
      <div style={{ textAlign: "center" }}>
        <button
          type="submit"
          style={{
            backgroundColor: "#1a2e59",
            color: "white",
            padding: "10px 20px",
            border: "none",
            borderRadius: 8,
            fontWeight: 600,
            cursor: "pointer",
          }}
        >
          üìÑ Í≤¨Ï†ÅÏÑú ÏÉùÏÑ±
        </button>
      </div>
    </form>
  );
}
